import React from 'react';
import {Row, Col, Container} from 'react-bootstrap';
import './sidebar.css';
//import '../../custom.scss';

function Example() {
  return (
        <Container fluid>
            <Row className='row flex-xl-nowrap'>
                <Col className="col-12 col-md-3 col-xl-2 bd-sidebar">
                Bava
                </Col>
                <Col className="sidebar">
                Bava
                </Col>
            </Row>
            
        </Container>
    )
}

export default Example;
